private static void cleanup(Logger log, java.io.Closeable closeable) {
  if (closeable != null) {
    try {
      closeable.close();
    } catch(IOException e) {
      if (log != null) {
        log.debug("Exception in closing {}", closeable, e);
      }
    }
  }
}
